Entangled Lives

// - - - - - - - - - - - - - - -

We are lovers, we are friends, we are connected, we are entangled, we are individuals, we are one.

// - - - - - - - - - - - - - - -

Usage: Use the mouse (or touch) in the x-direction to control the length of the lines. Use the mouse (or touch) in the y-direction to control the level of detail in the lines.

// - - - - - - - - - - - - - - -

Resolution & export instructions:
key 0: fit in window
key 1: 1024x1024px
key 2: 2048x2048px
key s: save as png in current resolution
key g: save as 9 sec gif in current resolution

